INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Bệnh viện Hữu nghị Việt Đức', 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', '<p>GIỚI THIỆU</p>\n<p><strong>Địa chỉ</strong>:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<ul>\n<li>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</li>\n</ul>\n<p><strong>Thời gian làm việc</strong>: Thứ 2 đến thứ 7</p>\n<ul>\n<li>\n<p>Sáng: 7h00 - 12h00</p>\n</li>\n<li>\n<p>Chiều: 13h30 - 16h30</p>\n</li>\n</ul>\n<p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.</li>\n<li>Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.</li>\n<li>Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.</li>\n</ul>\n', 'GIỚI THIỆU\n\n**Địa chỉ**:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\n* Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc**: Thứ 2 đến thứ 7\n\n* Sáng: 7h00 - 12h00\n\n* Chiều: 13h30 - 16h30\n\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.\n \n Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.\n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.\n\n **Lưu ý quan trọng**\n\n* Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\n* Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\n* Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.', 'data:image/jpeg;base64,', '2022-04-26 22:15:06', '2022-04-26 22:15:06');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(3, 'Bệnh viện Chợ Rẫy', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', '<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p><strong>Địa chỉ bệnh viện</strong>:</p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong>:\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>Thứ 2 đến thứ 6: từ 7h – 16h</li>\n<li>Thứ 7: từ 7h – 11h</li>\n</ul>\n', 'Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\n**Địa chỉ bệnh viện**:\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\n**Thời gian làm việc**:\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\n* Thứ 2 đến thứ 6: từ 7h – 16h\n* Thứ 7: từ 7h – 11h\n\n', 'data:image/jpeg;base64,', '2022-04-26 22:21:02', '2022-04-26 22:21:02');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(4, 'Phòng khám Bệnh viện Đại học Y Dược 1', '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', '<p>GIỚI THIỆU</p>\n<p><strong>Địa chỉ</strong>:\n20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong></p>\n<ul>\n<li>Thứ 2 tới thứ 6: 07h30 - 16h30</li>\n<li>Thứ 7: 07h30 - 12h00</li>\n</ul>\n<p>Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p>\n<p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và một số bệnh viện tên tuổi khác.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau.</li>\n<li>Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.</li>\n</ul>\n', 'GIỚI THIỆU\n\n**Địa chỉ**:\n20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\n**Thời gian làm việc**\n\n* Thứ 2 tới thứ 6: 07h30 - 16h30\n* Thứ 7: 07h30 - 12h00\n\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.\n\nCác bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và một số bệnh viện tên tuổi khác.\n\n**Lưu ý quan trọng**\n\n* Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau. \n* Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.', 'data:image/jpeg;base64,', '2022-04-26 22:23:53', '2022-04-26 22:23:53');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(5, 'Bệnh viện K - Cơ sở Phan Chu Trinh', '9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội', '<p>GIỚI THIỆU</p>\n<p><strong>Địa chỉ</strong>: 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội</p>\n<p><strong>Thời gian làm việc</strong>: Thứ 2 đến thứ 7 (6h00 - 17h00)</p>\n<p>Bệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:</p>\n<ul>\n<li>Cấp cứu, khám bệnh, chữa bệnh, phòng bệnh.</li>\n<li>Phục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.</li>\n<li>Đào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.</li>\n<li>Nghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.</li>\n</ul>\n<p><strong>Người bệnh có thể lựa chọn một trong các mức khám theo yêu cầu sau</strong>:</p>\n<ul>\n<li>Gói 1: Khám Giáo sư, Phó Giáo sư - Chi phí: 500.000 đồng/lần khám.</li>\n<li>Gói 2: Khám Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí: 300.000 đồng/lần khám.</li>\n<li>Gói 3: Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 200.000 đồng/ lần khám.</li>\n</ul>\n', 'GIỚI THIỆU\n\n**Địa chỉ**: 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc**: Thứ 2 đến thứ 7 (6h00 - 17h00)\n\nBệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:\n\n* Cấp cứu, khám bệnh, chữa bệnh, phòng bệnh.\n* Phục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.\n* Đào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.\n* Nghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.\n\n**Người bệnh có thể lựa chọn một trong các mức khám theo yêu cầu sau**:\n\n* Gói 1: Khám Giáo sư, Phó Giáo sư - Chi phí: 500.000 đồng/lần khám.\n* Gói 2: Khám Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí: 300.000 đồng/lần khám.\n* Gói 3: Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 200.000 đồng/ lần khám.', 'data:image/jpeg;base64,', '2022-04-26 22:27:54', '2022-04-26 22:27:54');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(6, 'Hệ thống Y tế Thu Cúc', 'Cơ sở 1: 286 Thụy Khuê, Tây Hồ, Hà Nội Cơ sở 2: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội Cơ sở 3: 32 Đại Từ, Hoàng Mai, Hà Nội', '<p>GIỚI THIỆU</p>\n<p><strong>Địa chỉ</strong>:</p>\n<ul>\n<li>Cơ sở 1: 286 Thụy Khuê, Tây Hồ, Hà Nội.</li>\n<li>Cơ sở 2: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội.</li>\n<li>Cơ sở 3: 32 Đại Từ, Hoàng Mai, Hà Nội.</li>\n</ul>\n<p><strong>Thời gian làm việc chung</strong>:</p>\n<p>Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc triển khai giờ làm việc như sau:</p>\n<ul>\n<li>Bệnh viện Đa khoa Quốc tế Thu Cúc - 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7.</li>\n<li>Phòng khám Đa khoa Quốc tế Thu Cúc - 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần.</li>\n<li>Phòng khám Đa khoa Thu Cúc - 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần.</li>\n</ul>\n<p>Hệ thống Y tế Thu Cúc hướng mục tiêu trở thành một trong những đơn vị khám chữa bệnh hàng đầu trong cả nước, địa chỉ khám chữa bệnh uy tín cho người dân. Các cơ sở thăm khám của Hệ thống Y tế Thu Cúc được đầu tư trang bị y tế hiện đại, đạt tiêu chuẩn quốc tế, kết hợp với đội ngũ bác sĩ giỏi nhằm đưa đến kết quả khám bệnh chính xác nhất và điều trị bệnh tốt nhất cho người dân. Đồng thời, tạo một môi trường y tế an toàn, thân thiện, chất lượng cao hơn cho tất cả mọi người.</p>\n<p><strong>Một số lưu ý</strong></p>\n<ol>\n<li>Phòng khám Đa khoa Quốc tế Thu Cúc tại 216 Trần Duy Hưng và 32 Đại Từ chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến Bệnh Viện Đa khoa Quốc tế Thu Cúc tại 286 Thụy Khuê.</li>\n<li>Phòng khám Đa khoa Quốc tế Thu Cúc có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.</li>\n<li>Phòng khám có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:</li>\n</ol>\n<ul>\n<li>Ưu tiên các trường hợp cấp cứu.</li>\n<li>Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.</li>\n<li>Người bệnh đặt hẹn (có dấu đã đặt hẹn).</li>\n<li>Người bệnh khám các dịch vụ khác.</li>\n</ul>\n', 'GIỚI THIỆU\n\n**Địa chỉ**:\n\n* Cơ sở 1: 286 Thụy Khuê, Tây Hồ, Hà Nội.\n* Cơ sở 2: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội.\n* Cơ sở 3: 32 Đại Từ, Hoàng Mai, Hà Nội.\n\n**Thời gian làm việc chung**:\n\nNhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc triển khai giờ làm việc như sau:\n\n* Bệnh viện Đa khoa Quốc tế Thu Cúc - 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7.\n* Phòng khám Đa khoa Quốc tế Thu Cúc - 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần.\n* Phòng khám Đa khoa Thu Cúc - 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần.\n\nHệ thống Y tế Thu Cúc hướng mục tiêu trở thành một trong những đơn vị khám chữa bệnh hàng đầu trong cả nước, địa chỉ khám chữa bệnh uy tín cho người dân. Các cơ sở thăm khám của Hệ thống Y tế Thu Cúc được đầu tư trang bị y tế hiện đại, đạt tiêu chuẩn quốc tế, kết hợp với đội ngũ bác sĩ giỏi nhằm đưa đến kết quả khám bệnh chính xác nhất và điều trị bệnh tốt nhất cho người dân. Đồng thời, tạo một môi trường y tế an toàn, thân thiện, chất lượng cao hơn cho tất cả mọi người.\n\n**Một số lưu ý**\n\n1. Phòng khám Đa khoa Quốc tế Thu Cúc tại 216 Trần Duy Hưng và 32 Đại Từ chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến Bệnh Viện Đa khoa Quốc tế Thu Cúc tại 286 Thụy Khuê.\n2. Phòng khám Đa khoa Quốc tế Thu Cúc có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.\n3. Phòng khám có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:\n\n \n* Ưu tiên các trường hợp cấp cứu.\n* Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.\n* Người bệnh đặt hẹn (có dấu đã đặt hẹn).\n* Người bệnh khám các dịch vụ khác.', 'data:image/jpeg;base64,', '2022-04-26 22:33:08', '2022-04-26 22:33:08');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(7, 'Bệnh viện Nam học và Hiếm muộn Hà Nội', '431 Tam Trinh (Lô 01 – 8A), Hoàng Mai, Hà Nội', '<p>GIỚI THIỆU</p>\n<p><strong>Địa chỉ</strong>: 431 Tam Trinh (Lô 01-8A cụm tiểu thủ công nghiệp Hai Bà Trưng),Phường Hoàng Văn Thụ, Quận Hoàng Mai, Hà Nội.</p>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>Từ thứ 2 - Thứ 7: 7h30 - 17h00 (Làm cả buổi trưa).</li>\n<li>Sáng Chủ nhật:7h30 - 12h00.</li>\n</ul>\n<p>Bệnh viện Nam Học và Hiếm Muộn Hà Nội (Andrology And Fertility Hospital Of Hanoi) thành lập năm 2009 với chức năng điều trị bệnh lý Nam khoa &amp; Y học giới tính, Sức khỏe sinh sản và Vô sinh – Hiếm muộn (cho cả nam và nữ). Bệnh viện là cơ sở y tế ngoài công lập đầu tiên ở Miền Bắc được cấp phép thực hiện Kỹ thuật Thụ tinh trong ống nghiệm (TTTON).</p>\n<p>Từ 2009 đến nay, Bệnh viện đã đón tiếp hàng chục nghìn lượt bệnh nhân tới khám, chữa bệnh và hàng ngàn cặp vợ chồng thực hiện kĩ thuật TTTON với tỷ lệ thành công rất cao (tương đương với tỷ lệ của các trung tâm thụ tinh ống nghiệm lớn trong nước và quốc tế) nhờ các phác đồ điều trị và can thiệp y khoa thích hợp.</p>\n', 'GIỚI THIỆU\n\n**Địa chỉ**: 431 Tam Trinh (Lô 01-8A cụm tiểu thủ công nghiệp Hai Bà Trưng),Phường Hoàng Văn Thụ, Quận Hoàng Mai, Hà Nội.\n\n**Thời gian làm việc**: \n\n* Từ thứ 2 - Thứ 7: 7h30 - 17h00 (Làm cả buổi trưa).\n* Sáng Chủ nhật:7h30 - 12h00.\n\nBệnh viện Nam Học và Hiếm Muộn Hà Nội (Andrology And Fertility Hospital Of Hanoi) thành lập năm 2009 với chức năng điều trị bệnh lý Nam khoa & Y học giới tính, Sức khỏe sinh sản và Vô sinh – Hiếm muộn (cho cả nam và nữ). Bệnh viện là cơ sở y tế ngoài công lập đầu tiên ở Miền Bắc được cấp phép thực hiện Kỹ thuật Thụ tinh trong ống nghiệm (TTTON).\n\nTừ 2009 đến nay, Bệnh viện đã đón tiếp hàng chục nghìn lượt bệnh nhân tới khám, chữa bệnh và hàng ngàn cặp vợ chồng thực hiện kĩ thuật TTTON với tỷ lệ thành công rất cao (tương đương với tỷ lệ của các trung tâm thụ tinh ống nghiệm lớn trong nước và quốc tế) nhờ các phác đồ điều trị và can thiệp y khoa thích hợp.\n\n', 'data:image/jpeg;base64,', '2022-04-26 22:35:52', '2022-04-26 22:35:52');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(8, 'Bệnh viện Đa khoa Hồng Phát', 'Số 219 Lê Duẩn - Hai Bà Trưng - Hà Nội', '<p>GIỚI THIỆU</p>\n<p><strong>Địa chỉ</strong>: 219 Lê Duẩn, Hai Bà Trưng, Hà Nội.</p>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>Thứ 2 đến Chủ Nhật</li>\n<li>Từ 7h30 đến 17h00</li>\n</ul>\n<p>Bệnh viện Đa khoa Hồng Phát được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện Đa khoa Hồng Phát hội tụ đội ngũ giáo sư, bác sĩ đầu ngành có chuyên môn cao và giàu kinh nghiệm. Hầu hết các y, bác sĩ đang làm việc tại đây đều là những người đã và đang công tác tại các bệnh viện lớn tuyến Trung ương như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện E Hà Nội, Bệnh viện K, Bệnh viện TW Quân đội 108, Bệnh viện Phụ sản TW,…</p>\n<p><strong>Hình thức thanh toán</strong>: Bệnh viện nhận thanh toán bằng tiền mặt và quẹt thẻ.</p>\n', 'GIỚI THIỆU\n\n**Địa chỉ**: 219 Lê Duẩn, Hai Bà Trưng, Hà Nội.\n\n**Thời gian làm việc**: \n\n* Thứ 2 đến Chủ Nhật\n* Từ 7h30 đến 17h00\n\nBệnh viện Đa khoa Hồng Phát được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện Đa khoa Hồng Phát hội tụ đội ngũ giáo sư, bác sĩ đầu ngành có chuyên môn cao và giàu kinh nghiệm. Hầu hết các y, bác sĩ đang làm việc tại đây đều là những người đã và đang công tác tại các bệnh viện lớn tuyến Trung ương như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện E Hà Nội, Bệnh viện K, Bệnh viện TW Quân đội 108, Bệnh viện Phụ sản TW,…\n\n**Hình thức thanh toán**: Bệnh viện nhận thanh toán bằng tiền mặt và quẹt thẻ.', 'data:image/jpeg;base64,', '2022-04-26 22:37:37', '2022-04-26 22:37:37');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(9, 'Bệnh viện Đa khoa An Việt', 'Số 1E Trường Chinh - Thanh Xuân - Hà Nội.', '<p>GIỚI THIỆU</p>\n<p><strong>Địa chỉ</strong>: Số 1E Trường Chinh, Thanh Xuân, Hà Nội</p>\n<p><strong>Thời gian làm việc</strong>: Thứ 2 đến Chủ Nhật</p>\n<ul>\n<li>Sáng: Từ 7h30 – 12h00</li>\n<li>Chiều: Từ 13h30 – 16h30</li>\n</ul>\n<p>Bệnh viện Đa khoa An Việt là bệnh viện Đa khoa tư nhân với đội ngũ bác sĩ từ các bệnh viện lớn trên địa bàn thành phố Hà Nội: Bệnh viện Tai mũi họng Trung ương, Bệnh viện Phụ sản Trung ương, Bệnh viện K, Bệnh viện Việt Đức,... Bệnh viện được đánh giá cao về sự đầu tư cơ sở hạ tầng và trang thiết bị. Bệnh viện được định hướng trở thành bệnh viện top đầu về chuyên môn và công nghệ, đạt tiêu chuẩn cao nhất về quản lý chất lượng và an toàn cho bệnh nhân.</p>\n<p><strong>Lưu ý khi đi khám</strong></p>\n<ul>\n<li>Nên mang theo thẻ bảo hiểm y tế hoặc thẻ bảo hiểm bảo lãnh.</li>\n</ul>\n', 'GIỚI THIỆU\n\n**Địa chỉ**: Số 1E Trường Chinh, Thanh Xuân, Hà Nội\n\n**Thời gian làm việc**: Thứ 2 đến Chủ Nhật\n* Sáng: Từ 7h30 – 12h00\n* Chiều: Từ 13h30 – 16h30\n\nBệnh viện Đa khoa An Việt là bệnh viện Đa khoa tư nhân với đội ngũ bác sĩ từ các bệnh viện lớn trên địa bàn thành phố Hà Nội: Bệnh viện Tai mũi họng Trung ương, Bệnh viện Phụ sản Trung ương, Bệnh viện K, Bệnh viện Việt Đức,... Bệnh viện được đánh giá cao về sự đầu tư cơ sở hạ tầng và trang thiết bị. Bệnh viện được định hướng trở thành bệnh viện top đầu về chuyên môn và công nghệ, đạt tiêu chuẩn cao nhất về quản lý chất lượng và an toàn cho bệnh nhân. \n\n**Lưu ý khi đi khám**\n\n* Nên mang theo thẻ bảo hiểm y tế hoặc thẻ bảo hiểm bảo lãnh.', 'data:image/jpeg;base64,', '2022-04-26 22:41:46', '2022-04-26 22:41:46');

